css:
.text-info code {
  color: #5293d8;
  background: rgba(0, 152, 255, 0.2);
}
.text-info a,
.text-info a code {
  text-decoration: underline;
  color: #2d79ca;
}
.text-info a:hover,
.text-info a code:hover {
  color: #296db5;
}
.text-success code {
  color: #2bda77;
  background: rgba(23, 202, 101, 0.2);
}
.text-success a,
.text-success a code {
  text-decoration: underline;
  color: #1fb35f;
}
.text-success a:hover,
.text-success a code:hover {
  color: #1b9d54;
}
.text-warning code {
  color: #ff982d;
  background: rgba(255, 170, 44, 0.2);
}
.text-warning a,
.text-warning a code {
  text-decoration: underline;
  color: #f97f00;
}
.text-warning a:hover,
.text-warning a code:hover {
  color: #e07200;
}
.text-error code {
  color: #cc0000;
  background: rgba(204, 0, 0, 0.2);
}
.text-error a,
.text-error a code {
  text-decoration: underline;
  color: #990000;
}
.text-error a:hover,
.text-error a code:hover {
  color: #800000;
}
